import React from 'react';
import {Difficulty} from "./Difficulty";
import logo from "../img/logo.png"


export class MainMenu extends React.Component {
    render() {
        return (
            <div className="main-menu">
                <div className="main-menu-titles">
                    <h1 className="main-menu-title">Snake</h1>
                    <h2 className="main-menu-subtitle">by Philipp Bulanin</h2>
                </div>
                <Difficulty
                    changeLevel={this.props.changeLevel}
                />
                <img className="main-menu-logo" src={logo} alt="logo"/>
                <button className="main-menu-btn" onClick={this.props.start}>Start</button>
            </div>
        )
    }
}
